import React from "react";

import "./App.css";
import AppHeader from "./components/Header";

function App() {
    return(
         <div className="App">
        <AppHeader/>
        <div className="SideMenuAndPageContent">
        <SideMenu></SideMenu>
        <PageContent></PageContent>
      </div>
    </div>
    );
}

export default App;
